script: |
  super -f tsv -I q850.sql | sort > q850.out

vector: true

inputs:
  - name: q850.sql
    data: |
      SELECT DISTINCT + 73 * - COUNT ( * ) AS col0, - 17 + + - COUNT ( ALL + CAST ( - 57 AS INTEGER ) ) + COUNT ( * ) AS col0, + 80;

outputs:
  - name: q850.out
    data: |
      -73	-17	80
